--  DDL for View EBA_DP_RPT_VAL_HISTORY_V
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."EBA_DP_RPT_VAL_HISTORY_V" ("VALIDATION_ID", "REPORT_ID", "REPORT_NAME", "REPORT_TYPE", "CHILD_REPORT_ID", "CHILD_REPORT_TYPE", "CHILD_REPORT_NAME", "STATUS", "SQL_QUERY", "ERROR_MSG", "DEPENDENT_OBJECT_CNT", "VALIDATION_POINT", "VALIDATED", "VALIDATED_BY") AS 
  select x.validation_id,
       x.report_id,
       x.report_name,
       x.report_type,
       x.child_report_id,
       x.child_report_type,
       x.child_report_name,
       x.status,
       x.sql_query,
       x.error_msg,
       (select count(*) from eba_dp_rpt_val_dependencys d where d.validation_id = x.validation_id) dependent_object_cnt,
       x.validation_point,
       x.validated,
       x.validated_by
from
(select v.id validation_id,
       v.report_id,
       r.report_name,
       t.type_name report_type,
       null child_report_id,
       null child_report_type,
       null child_report_name,       
       v.status,
       v.sql_query,
       v.error_msg,
       v.validation_point,                  
       v.validated,
       v.validated_by
from eba_dp_report_validations v, eba_dp_reports r, eba_dp_rpt_types t
where v.report_id = r.id
and r.report_type_id = t.id
and t.type_name in ('Interactive Report','Calendar','Filter Report')
union all
select v.id validation_id,
       v.report_id,
       r.report_name,
       t.type_name report_type,
       v.child_table_id child_report_id,
       wt.widget_name child_report_type,
       w.widget_name child_report_name,       
       v.status, 
       v.sql_query,                
       v.error_msg,
       v.validation_point,                  
       v.validated,
       lower(v.validated_by) validated_by
from eba_dp_report_validations v, eba_dp_reports r, eba_dp_rpt_types t, eba_dp_widgets w, eba_dp_widget_types wt
where v.report_id = r.id
and r.report_type_id = t.id
and w.id = v.child_table_id
and wt.id = w.widget_type_id
and t.type_name = 'Dashboard'
union all
select v.id validation_id,
       v.report_id,
       r.report_name,
       t.type_name report_type,
       v.child_table_id child_report_id,
       p.report_type child_report_type,
       case when p.report_type = 'masterdetail' and ps.sql_source_seq = 1 then
         'Master'
       when p.report_type = 'masterdetail' and ps.sql_source_seq = 2 then
         'Detail'
       end child_report_name,       
       v.status,
       v.sql_query,               
       v.error_msg,
       v.validation_point,                   
       v.validated,
       lower(v.validated_by) validated_by
from eba_dp_report_validations v, eba_dp_reports r, eba_dp_rpt_types t, eba_dp_pdf_rpt_src ps, eba_dp_pdf_rpt p
where v.report_id = r.id
and r.report_type_id = t.id
and ps.id = v.child_table_id
and p.report_id = r.id
and ps.pdf_rpt_id = p.id
and t.type_name = 'PDF Report') x
;
