--  DDL for View EBA_DP_RPT_VAL_V
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."EBA_DP_RPT_VAL_V" ("VALIDATION_ID", "REPORT_ID", "REPORT_NAME", "REPORT_TYPE", "CHILD_REPORT_ID", "CHILD_REPORT_TYPE", "CHILD_REPORT_NAME", "STATUS", "SQL_QUERY", "ERROR_MSG", "DEPENDENT_OBJECT_CNT", "VALIDATION_POINT", "VALIDATED", "VALIDATED_BY") AS 
  select l.validation_id,
       l.report_id,
       l.report_name,
       l.report_type,
       l.child_report_id,
       l.child_report_type,
       l.child_report_name,
       h.status,
       h.sql_query,
       h.error_msg,
       h.dependent_object_cnt,
       h.validation_point,
       h.validated,
       h.validated_by
from eba_dp_rpt_val_history_v h,
    -- last validation in the history
    (select max(validation_id) validation_id,
            max(validated) validated,
            report_id,
            report_name,
            report_type,
            child_report_id,
            child_report_type,
            child_report_name
    from eba_dp_rpt_val_history_v
    group by report_id, report_name, report_type, child_report_id, child_report_type, child_report_name) l 
where l.validation_id = h.validation_id
;
