  'C-2' || nvl(jahr,0) parent,
  'Monat: ' || monat,
  'B - Monat ' ||  monat
from t_bas_kal_arbeitstage
union
--2. Ebene
select 
  'E-1' ||  nvl(jahr,0) || nvl(monat,0) as child,
