  'Arbeitstage ' ||  nvl(jahr,0) || nvl(monat,0) || 0 ,
  'C - Monat ' ||  monat
from t_bas_kal_arbeitstage
--2. Ebene

union
--3. Ebene
select 
  'F' ||  tbel.pk_bel_beleg,
  'E-1' || nvl(jahr,0) || nvl(monat,0),
  tbel.pk_bel_beleg || ' ' || tbel.datum || ' ' || tbel.beleg,
