--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_CONTR_KONTROLLE" ("PK_CONTR_KONTROLLE", "JAHR", "KONTO", "FINALISIERUNGSDATUM", "RELATION", "BETRAG", "BUCHUNGSTEXT", "BUCHDAT", "STATUS", "KST", "KTR", "UST", "UST_KTO", "HABENKTO", "SOLLKTO", "DATUM_OK", "BEMERKUNGEN", "FK_LEX_STORNO", "ZUSATZANG", "STEUERSCHLUESSEL", "BELEGNR", "PERIODE", "BELEGDAT") AS 
  SELECT
        kon."PK_CONTR_KONTROLLE",
        kon."JAHR",
        kon."KONTO",
        kon."FINALISIERUNGSDATUM",
        relation,
        betrag,
        buchungstext,
        buchdat,
        status,
        kst,
        ktr,
        ust,
        ust_kto,
        habenkto,
        sollkto,
        datum_ok,
        bemerkungen,
        fk_lex_storno,
        zusatzang,
        Steuerschluessel,
        belegnr,
        periode,
  
        belegdat
    FROM
        t_contr_kontrolle kon
 left JOIN t_lex_long ON t_lex_long.sollkto = kon.konto
;
--------------------------------------------------------
--  DDL for View V_DB_APEX_PAGES_CONTENT
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_DB_APEX_PAGES_CONTENT" ("PK_DB_APEX_PAGES_CONTENT", "WORKSPACE_ID", "APPLICATION_ID", "PAGE_ID", "TXT_LINE", "COMM", "CREATION_DATE", "FILTER", "KATEGORIE", "KOMP", "KOMP_TYPE", "FIL_TXT_LINE", "END_LINE") AS 
  select pgcon."PK_DB_APEX_PAGES_CONTENT",pgcon."WORKSPACE_ID",pgcon."APPLICATION_ID",pgcon."PAGE_ID",pgcon."TXT_LINE",pgcon."COMM",pgcon."CREATION_DATE", pgconfil.filter, pgconfil.kategorie, case when instr(txt_line, filter )> 0 then  1 else 0 end komp, case when instr(txt_line, filter )> 0 then  kategorie else '' end komp_type, case when instr(txt_line, filter )> 0 then txt_line else '' end fil_txt_line, case when instr(txt_line, filter )> 0 then substr(txt_line, instr(txt_line, filter )+lengtH(filter), length(txt_line)) else '' end end_line
from t_db_apex_pages_content pgcon, 
t_db_apex_pages_content_filter pgconfil
;
--------------------------------------------------------
--  DDL for View V_DB_CHECK_TABLE
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_DB_CHECK_TABLE" ("DB") AS 
  select 'select ' || rownum || ' pos , ' || chr(39) || ut.table_name || chr(39) ||  ' table_name, count(*) cnt from ' || ut.table_name || ' union' db
  from user_tables ut 
   left join v_db_check_table_content_cnt tc on ut.table_name = tc.object_name and tc.object_type = 'TABLE'
   where tc.object_name is null
;
