--  DDL for View V_KONTR_OK_LEX
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_KONTR_OK_LEX" ("BUCHT_JAHR", "CNT_JAHR", "CNT_LEX") AS 
