  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_REL_ALL" ("FK_INP_BELEGE_ALL", "FK_INP_BELEGE_ALL2", "FK_MAIN_KEY", "FK_MAIN_KEY2", "FK_INP_BELEGE_ALL3", "FK_MAIN_KEY3", "FK_INP_BELEGE_ALL4") AS 
  with rel1 as (  
select relbel1.fk_inp_belege_all, relbel11.fk_inp_belege_all fk_inp_belege_all2,relbel1.fk_main_key, relbel11.fk_main_key  fk_main_key2, relbel21.fk_inp_belege_all fk_inp_belege_all3, relbel21.fk_main_key fk_main_key3
from (select * from  t_rel_lex_kto_bel --where fk_inp_belege_all =  4133 
) relbel1
    --fk_Main_key
    left join t_rel_lex_kto_bel relbel11 on relbel1.fk_main_key = relbel11.fk_main_key
    left join t_rel_lex_kto_bel relbel12  on relbel1.fk_lex_relation = relbel12.fk_lex_relation
    --inp_belege
    left join t_rel_lex_kto_bel relbel21 on relbel11.fk_inp_belege_all = relbel21.fk_inp_belege_all
    left join t_rel_lex_kto_bel relbel22 on relbel11.fk_lex_relation= relbel22.fk_lex_relation
    --
    --left join t_rel_lex_kto_bel relbel23 on relbel12.fk_inp_belege_all = relbel23.fk_inp_belege_all
    --left join t_rel_lex_kto_bel relbel24 on relbel12.fk_lex_relation= relbel24.fk_lex_relation
--where relbel1.fk_inp_belege_all <> relbel2.fk_inp_belege_all
--and relbel2.fk_main_key <> relbel3.fk_main_key
)
select distinct rel1."FK_INP_BELEGE_ALL",rel1."FK_INP_BELEGE_ALL2",rel1."FK_MAIN_KEY",rel1."FK_MAIN_KEY2",rel1."FK_INP_BELEGE_ALL3",rel1."FK_MAIN_KEY3", relbel4.fk_inp_belege_all fk_inp_belege_all4
from rel1
 left join t_rel_lex_kto_bel relbel4 on rel1.fk_main_key3 = relbel4.fk_main_key
where relbel4.fk_inp_belege_all <> fk_inp_belege_all3
;
