  select hbm."PK_REL_TYP_HERSTELLER_BAUREIHE_MODELL",hbm."FK_MDT_MANDANT",hbm."CREATED_AT",hbm."MODIFIED_AT",hbm."FK_KON_HERSTELLER",hbm."FK_BAS_TYP_BAUREIHE",hbm."FK_BAS_TYP_MODELL",hbm."COMM",hbm."VALID",hbm."VALID_FROM",hbm."VALID_TO", mandant, her.GESCHAEFTSPARTNER, br.baureihe, md.MODELL_NO, std_value type_modell
from t_rel_typ_hersteller_baureihe_modell hbm
 left join t_mdt_mandant mdt on mdt.pk_mdt_mandant = hbm.fk_mdt_mandant
 left join t_kon_geschaeftspartner her on her.pk_kon_geschaeftspartner = hbm.fk_kon_hersteller
 left join t_bas_typ_baureihe br on br.pk_bas_typ_baureihe = hbm.fk_bas_typ_baureihe
 left join t_bas_typ_modell md on md.pk_bas_typ_modell = hbm.fk_bas_typ_modell
 left join (select * from t_std where fK_std_group = 483) tp on tp.std_value = md.fk_bas_typ_type
;
