  CREATE OR REPLACE FORCE EDITIONABLE VIEW "COMPANY"."V_WORK_STUNDENSATZ" ("PK_WORK_STUNDENSATZ", "FK_MDT_MANDANT", "CREATED_AT", "MODIFIED_AT", "FK_KON_PERSON", "FK_PROJ_PROJEKT", "FK_WORK_TAETIGKEIT", "VALID", "VALID_FROM", "VALID_TO", "DESCR", "COMM", "FLG_VALID_FEIERTAG", "FLG_VALID_UEBERSTUNDEN", "FLG_VALID_WOCHENENDE", "FK_STD_KON_PERSON_ROLE", "FK_REL_WF_WORKFLOW_WORKFLOW", "STUNDENSATZ", "STD_NAME", "FK_REL_ORG_ORG_UNIT_ORG_UNIT", "PROJEKT", "BEZEICHNUNG", "KATEGORIE", "ORG_UNIT_NAME", "MAIN_ORG_UNIT_NAME") AS 
  select stdsatz.PK_WORK_STUNDENSATZ,
       stdsatz.FK_MDT_MANDANT,
       stdsatz.CREATED_AT,
       stdsatz.MODIFIED_AT,
       stdsatz.FK_KON_PERSON,
       stdsatz.FK_PROJ_PROJEKT,
       stdsatz.FK_WORK_TAETIGKEIT,
       stdsatz.VALID,
       stdsatz.VALID_FROM,
       stdsatz.VALID_TO,
       stdsatz.DESCR,
       stdsatz.COMM,
       stdsatz.FLG_VALID_FEIERTAG,
       stdsatz.FLG_VALID_UEBERSTUNDEN,
       stdsatz.FLG_VALID_WOCHENENDE,
       stdsatz.FK_std_KON_PERSON_ROLE,
       stdsatz.FK_rel_WF_WORKFLOW_workflow,
       stdsatz.STUNDENSATZ,
       std.std_name,
       stdsatz.FK_REL_ORG_ORG_UNIT_ORG_UNIT,
       proj.projekt,
       wf.bezeichnung,
       kat.kategorie,
       org.ORG_UNIT_NAME,
       org_main.ORG_UNIT_NAME main_ORG_UNIT_NAME
  from T_WORK_STUNDENSATZ stdsatz
    left join t_proj_projekt proj on stdsatz.fk_proj_projekt = proj.pk_proj_projekt
    left join t_rel_wf_workflow_workflow relwf on relwf.pk_rel_wf_workflow_workflow = stdsatz.fk_rel_wf_workflow_workflow
    left join t_wf_workflow wf on wf.pk_wf_workflow = relwf.fk_wf_workflow
    left join (select * from t_std where fk_std_group = 723) std on std.std_value = stdsatz.fk_std_kon_person_role
    left join t_bas_kat_kategorie kat on kat.pk_bas_kat_kategorie = stdsatz.fk_bas_kat_kategorie
    left join t_rel_org_org_unit_org_unit relorg on relorg.pk_rel_org_org_unit_org_unit = stdsatz.fk_rel_org_org_unit_org_unit
    left join t_org_unit org on org.pk_org_unit = relorg.fk_org_org_unit
    left join t_org_unit org_main on org_main.pk_org_unit = relorg.fk_org_org_unit_Main
;
